import React, { useState } from 'react';
import {
  Container,
  Typography,
  Paper,
  TextField,
  Button,
  Box,
  CircularProgress,
  Alert,
  Grid,
  Card,
  CardContent,
  Chip,
} from '@mui/material';
import { CloudUpload as UploadIcon } from '@mui/icons-material';
import axios from 'axios';

interface AnalysisResult {
  tables: Array<{
    name: string;
    fields: Array<{
      name: string;
      type: string;
      description: string;
    }>;
  }>;
  relationships: Array<{
    from: string;
    to: string;
    type: string;
  }>;
  codeSnippets: Array<{
    file: string;
    line: number;
    code: string;
    description: string;
  }>;
}

const Analysis: React.FC = () => {
  const [file, setFile] = useState<File | null>(null);
  const [code, setCode] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [result, setResult] = useState<AnalysisResult | null>(null);

  const handleFileChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    if (event.target.files && event.target.files[0]) {
      const selectedFile = event.target.files[0];
      const allowedExtensions = ['.py', '.js', '.ts', '.jsx', '.tsx'];
      const fileExtension = selectedFile.name.toLowerCase().slice(selectedFile.name.lastIndexOf('.'));

      if (!allowedExtensions.includes(fileExtension)) {
        setError('Invalid file type. Please upload a Python or JavaScript/TypeScript file.');
        return;
      }

      setFile(selectedFile);
      setError(null);
    }
  };

  const handleAnalyze = async () => {
    setLoading(true);
    setError(null);
    setResult(null);

    try {
      let response;
      if (file) {
        const formData = new FormData();
        formData.append('file', file);
        response = await axios.post('/api/analysis/analyze-file', formData);
      } else if (code) {
        response = await axios.post('/api/analysis/analyze', { code });
      } else {
        throw new Error('Please provide code to analyze');
      }

      setResult(response.data);
    } catch (err) {
      setError('Analysis failed. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="lg">
      <Typography variant="h4" gutterBottom>
        Code Analysis
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper sx={{ p: 3 }}>
            <Box sx={{ mb: 3 }}>
              <input
                accept=".py,.js,.ts,.jsx,.tsx"
                style={{ display: 'none' }}
                id="file-upload"
                type="file"
                onChange={handleFileChange}
              />
              <label htmlFor="file-upload">
                <Button
                  variant="outlined"
                  component="span"
                  startIcon={<UploadIcon />}
                >
                  Upload Code File
                </Button>
              </label>
              {file && (
                <Typography variant="body2" sx={{ mt: 1 }}>
                  Selected file: {file.name}
                </Typography>
              )}
            </Box>

            <Typography variant="h6" gutterBottom>
              Or paste your code:
            </Typography>
            <TextField
              fullWidth
              multiline
              rows={10}
              variant="outlined"
              placeholder="Paste your code here..."
              value={code}
              onChange={(e) => setCode(e.target.value)}
            />

            {error && (
              <Alert severity="error" sx={{ mt: 2 }}>
                {error}
              </Alert>
            )}

            <Box sx={{ mt: 2 }}>
              <Button
                variant="contained"
                onClick={handleAnalyze}
                disabled={loading || (!file && !code)}
              >
                {loading ? (
                  <>
                    <CircularProgress size={24} sx={{ mr: 1 }} />
                    Analyzing...
                  </>
                ) : (
                  'Analyze Code'
                )}
              </Button>
            </Box>
          </Paper>
        </Grid>

        {result && (
          <>
            <Grid item xs={12}>
              <Typography variant="h5" gutterBottom>
                Analysis Results
              </Typography>
            </Grid>

            {/* Tables and Fields */}
            {result.tables.map((table) => (
              <Grid item xs={12} md={6} key={table.name}>
                <Card>
                  <CardContent>
                    <Typography variant="h6" gutterBottom>
                      {table.name}
                    </Typography>
                    {table.fields.map((field, index) => (
                      <Box key={index} sx={{ mb: 1 }}>
                        <Typography variant="subtitle2">
                          {field.name}{' '}
                          <Chip
                            label={field.type}
                            size="small"
                            color="primary"
                            variant="outlined"
                          />
                        </Typography>
                        <Typography variant="body2" color="textSecondary">
                          {field.description}
                        </Typography>
                      </Box>
                    ))}
                  </CardContent>
                </Card>
              </Grid>
            ))}

            {/* Relationships */}
            <Grid item xs={12}>
              <Card>
                <CardContent>
                  <Typography variant="h6" gutterBottom>
                    Relationships
                  </Typography>
                  {result.relationships.map((rel, index) => (
                    <Box key={index} sx={{ mb: 1 }}>
                      <Typography variant="body1">
                        {rel.from} â†’ {rel.to} ({rel.type})
                      </Typography>
                    </Box>
                  ))}
                </CardContent>
              </Card>
            </Grid>

            {/* Code Snippets */}
            <Grid item xs={12}>
              <Card>
                <CardContent>
                  <Typography variant="h6" gutterBottom>
                    Code Snippets
                  </Typography>
                  {result.codeSnippets.map((snippet, index) => (
                    <Box key={index} sx={{ mb: 2 }}>
                      <Typography variant="subtitle2">
                        {snippet.file}:{snippet.line}
                      </Typography>
                      <Paper
                        sx={{
                          p: 2,
                          bgcolor: 'grey.100',
                          fontFamily: 'monospace',
                          mt: 1,
                        }}
                      >
                        <pre style={{ margin: 0 }}>{snippet.code}</pre>
                      </Paper>
                      <Typography variant="body2" color="textSecondary" sx={{ mt: 1 }}>
                        {snippet.description}
                      </Typography>
                    </Box>
                  ))}
                </CardContent>
              </Card>
            </Grid>
          </>
        )}
      </Grid>
    </Container>
  );
};

export default Analysis;
